def separate_paren_groups(paren_string: str) -> List[str]:
    stack = []
    result = []
    current_group = []

    for char in paren_string:
        if char == '(':
            stack.append(char)
            if len(stack) == 1:
                current_group.append('(')
        elif char == ')':
            if stack:
                stack.pop()
                current_group.append(')')

                if not stack:
                    result.append(''.join(current_group))
                    current_group = []

    return result

