def make_palindrome(string: str) -> str:
    def get_longest_palindrome_suffix(string: str) -> str:
        for i in range(len(string), 0, -1):
            if is_palindrome(string[-i:]):
                return string[-i:]
        return ''

    longest_palindrome_suffix = get_longest_palindrome_suffix(string)
    return string + string[:len(string) - len(longest_palindrome_suffix)][::-1] + longest_palindrome_suffix
