def minPath(grid, k):
    n = len(grid)
    visited = set()
    path = []

    def dfs(i, j, length):
        if length == k:
            return True
        visited.add((i, j))
        path.append(grid[i][j])
        if i > 0 and (i-1, j) not in visited:
            if dfs(i-1, j, length+1):
                return True
        if i < n-1 and (i+1, j) not in visited:
            if dfs(i+1, j, length+1):
                return True
        if j > 0 and (i, j-1) not in visited:
            if dfs(i, j-1, length+1):
                return True
        if j < n-1 and (i, j+1) not in visited:
            if dfs(i, j+1, length+1):
                return True

