        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True

    def fibonacci(n):
        if n <= 0:
            return 0
        elif n == 1:
            return 1
        else:
            return fibonacci(n - 1) + fibonacci(n - 2)

    count = 0
    fib_num = 0
    while count < n:
        fib_num += 1
        if is_prime(fibonacci(fib_num)):
            count += 1

    return fibonacci(fib_num)

