    consecutive_spaces = 0

    for char in text:
        if char == ' ':
            consecutive_spaces += 1
            if consecutive_spaces > 2:
                fixed_text = fixed_text.rstrip('-') + '-'
        else:
            if consecutive_spaces > 2:
                fixed_text = fixed_text.rstrip('-')
            fixed_text += '_' if char == ' ' else char
